import React from "react";

const ImageList = ({ image }) => {
  return (
    <div>
      <div className="max-w-sm rounded-md overflow-hidden shadow-lg">
        <div className="w-full rounded-md"></div>
        <img src={image.largeImageURL} alt={image.tags} />
        <div class="absolute top-0 left-0 w-full h-0 flex flex-col justify-center items-center bg-indigo-700 opacity-0 group-hover:h-full group-hover:opacity-100 duration-500"></div>
      </div>
    </div>
  );
};

<div className="relative ">
  <a className="absolute inset-0 z-10 bg-white text-center flex flex-col items-center justify-center opacity-0 hover:opacity-100 bg-opacity-90 duration-300">
    <h1 className="tracking-wider">Title</h1>
    <p className="mx-auto">Description</p>
  </a>
  <a href="#" className="relative">
    <div className="h-48 flex flex-wrap content-center">
      <img src={image.largeImageURL} alt={image.tags} />
    </div>
  </a>
</div>;

export default ImageList;
